import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { EventoListComponent } from './evento-list/evento-list.component';
import { EventoFormComponent } from './evento-form/evento-form.component';
import { SectionListComponent } from './section-list/ section-list.component';
import { SectionFormComponent } from './section-form/section-form.component';

const routes: Routes = [
  { path: 'eventos', component: EventoListComponent },
  { path: 'eventos/novo', component: EventoFormComponent },
  { path: 'eventos/:id/editar', component: EventoFormComponent },
  { path: 'eventos/:id/sections', component: SectionListComponent },
  { path: 'eventos/:id/sections/novo', component: SectionFormComponent },
  { path: 'eventos/:id/sections/:sectionId/editar', component: SectionFormComponent }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class AdminRoutingModule {}
